    color: {
        header: '#ebfbff',
        body: '#fff',
        footer: '#003333',
    }
}

const PlaceholderApp: FC<Props> = () => {
    return (
        <ThemeProvider theme={theme}>
            <>
              <Header/>  
            </>
        </ThemeProvider>
    )
}

export default PlaceholderApp
